<style>
	.icon-container{
		top:0px;
		width:100%;
		height:100%;
		position:absolute;
		left:0%;
	}

	.fallingLeaves {
			text-align: center;
      position: relative;
      top: -50px;
	}
	.fallingLeaves span {
			display: inline-block;
			margin: -500px 40px 54px  -34px;
			/* background:url("sprite-icons.png"); */
			-webkit-animation: fallingLeaves 7s infinite  linear;
			-moz-animation: fallingLeaves 7s infinite  linear;
	}
	.fallingLeaves span.img14, .fallingLeaves span.img18 {
			-webkit-animation-delay: 1.3s;
			-moz-animation-delay: 1.3s;
      -webkit-animation: fallingLeaves2 7s infinite  linear;
      -moz-animation: fallingLeaves2 7s infinite  linear;
	}
	.fallingLeaves span:nth-child(3n+2) {
      -webkit-animation: fallingLeaves 7s infinite  linear;
      -moz-animation: fallingLeaves 7s infinite  linear;
      -webkit-animation-delay: 1.5s;
			-moz-animation-delay: 1.5s;
	}
	.fallingLeaves span:nth-child(2n+5) {
      -webkit-animation: fallingLeaves2 7s infinite  linear;
      -moz-animation: fallingLeaves2 7s infinite  linear;
      -webkit-animation-delay: 1.7s;
			-moz-animation-delay: 1.7s;
	}

	.fallingLeaves span:nth-child(3n+10) {
      -webkit-animation: fallingLeaves 7s infinite  linear;
      -moz-animation: fallingLeaves 7s infinite  linear;
      -webkit-animation-delay: 2.7s;
      -moz-animation-delay: 2.7s;
	}
	.fallingLeaves span:nth-child(7n+2) {
      -webkit-animation: fallingLeaves2 7s infinite  linear;
      -moz-animation: fallingLeaves2 7s infinite  linear;
      -webkit-animation-delay: 3.5s;
			-moz-animation-delay: 3.5s;
	}
	.fallingLeaves span:nth-child(4n+5) {
      -webkit-animation: fallingLeaves 7s infinite  linear;
      -moz-animation: fallingLeaves 7s infinite  linear;
      -webkit-animation-delay: 5.5s;
			-moz-animation-delay: 5.5s;
	}
	.fallingLeaves span:nth-child(3n+7) {
      -webkit-animation: fallingLeaves2 7s infinite  linear;
      -moz-animation: fallingLeaves 7s infinite  linear;
      -webkit-animation-delay: 8s;
			-moz-animation-delay: 8s;
	}
	@-webkit-keyframes fallingLeaves {
		0% {
			opacity: 1;

		-webkit-transform: translate(0, 0px) rotateZ(0deg);
		}
		75% {
			opacity: 1;

		-webkit-transform: translate(100px, 600px) rotateZ(270deg);
		}
		100% {
			opacity: 0;

		-webkit-transform: translate(150px, 800px) rotateZ(360deg);
		}
	}
	@-moz-keyframes fallingLeaves {
		0% {
			opacity: 1;

		-webkit-transform: translate(0, 0px) rotateZ(0deg);
		}
		75% {
			opacity: 1;

		-webkit-transform: translate(100px, 600px) rotateZ(270deg);
		}
		100% {
			opacity: 0;

		-webkit-transform: translate(150px, 800px) rotateZ(360deg);
		}
	}
  @-webkit-keyframes fallingLeaves2 {
		0% {
			opacity: 1;

		-webkit-transform: translate(0, 0px) rotateZ(0deg);
		}
		75% {
			opacity: 1;

		-webkit-transform: translate(-100px, 600px) rotateZ(270deg);
		}
		100% {
			opacity: 0;

		-webkit-transform: translate(-150px, 800px) rotateZ(360deg);
		}
	}
	@-moz-keyframes fallingLeaves2 {
		0% {
			opacity: 1;

		-webkit-transform: translate(0, 0px) rotateZ(0deg);
		}
		75% {
			opacity: 1;

		-webkit-transform: translate(-100px, 600px) rotateZ(270deg);

  .ui {
    position: absolute;
    left: 50%;
    bottom: 5%;
    width: 300px;
    margin-left: -150px;
    display: none;
  }

  .ui-input {
    width: 100%;
    height: 50px;
    background: none;
    font-size: 24px;
    font-weight: bold;
    color: #fff;
    text-align: center;
    border: none;
    border-bottom: 2px solid white;
  }

  .ui-input:focus {
    outline: none;
    border: none;
    border-bottom: 2px solid white;
  }

  .ui-return {
    display: none;
    position: absolute;
    top: 20px;
    right: 0;
    padding: 3px 2px 0 2px;
    font-size: 10px;
    line-height: 10px;
    color: #fff;
    border: 1px solid #fff;
  }

  .ui--enter .ui-return {
    display: block;
  }

  .ui--wide {
    width: 76%;
    margin-left: 12%;
    left: 0;
  }

  .ui--wide .ui-return {
    right: -20px;
  }

  .help {
    position: absolute;
    top: 40px;
    right: 40px;
    width: 25px;
    height: 25px;
    text-align: center;
    font-size: 13px;
    line-height: 27px;
    font-weight: bold;
    cursor: pointer;
    background: #fff;
    /* color: #79a8ae; */
    opacity: .9;
    display: none;

    -o-transition: opacity 0.1s cubic-bezier(0.694, 0.0482, 0.335, 1);
    transition: opacity 0.1s cubic-bezier(0.694, 0.0482, 0.335, 1);
  }

  .help:hover {
    opacity: 1;
  }

  .overlay {
    position: absolute;
    top: 50%;
    left: 50%;
    width: 550px;
